//main
var slideWidth = 220;
// document.addEventListener("turbolinks:request-start", function(event) {
//     $("link[rel*='icon']").each(function(){
//         $(this).data('icon', $(this).attr("href")).attr("href", "/images/ring.gif");
//     });
